import React from 'react';
import TodoList from './components/TodoList';
import './App.css';

function App() {
  return (
    <div className="container">
      <h1 className="text-center my-4">Lista de Pendientes de la NFL</h1>
      <TodoList />
    </div>
  );
}

export default App;
